import React from "react";

const About = ()=>{
    return(
        <>
           <section>
               <div className="container-fluid">
                   <div className="row">
                       <div className="col-8 mx-auto">
                           <h2>Advantage of Our 24 Hour Yankees Locksmith Company</h2> 
                       </div>
                   </div>
               </div>
           </section>
        </>
    );
}

export default About;
